import { useState } from "react";

function Todo(){
  const [todo,setTodo]=useState("");
  function handel(event){
    const val=event.target.value;
    setTodo(val);
  }
    return(
        <div className="main">
        <div className="to-do-list">
            <input type="text" onChange={handel} placeholder="Add todo" id="demo"/>
            <input type="submit" value="Todo" class="btn" onClick={handel}/>
        </div>
        <ul class="todo-form">
            <li>
                <span>Do something</span>
                <div class="todo-btn">
                    <button className="done">Done</button>
                    <button className="remove">Remove</button>
                </div>
            </li>
        </ul>
    </div>

    );
}
export default Todo;
